story:
FUP i Tužilaštvo BiH vodili su istragu protiv grupe koju predvodi Kenan Tosun, a koja se bavi prodajom dionica putem call centara. 
Rezultati jednogodišnje istrage su:
- krivične prijave protiv 21 osobe mođu kojima je i pet turskih državljana za organizovani kriminal, prevaru i pranje novca. Jedan od prijavljenih je i , Tosunova desna ruka u Eufinu;
- krivične prijave protiv dva pravna subjekta Eufin d.o.o. i Roth Invest;
- najmanje 7 Njemaca i jedan Austrijjanac (policijac) oštećeni za oko 650.000 eura;
- najmanje 750.000 eura oprano preko firmi Eufin i Roth Invest

Ova grupa je prodavala dionice firmi Aurum Mining, Alta Aerial, Qtrak. Predstavljali su se u ime firmi Hartmann&Co iz Brisela, Parkers Consulting i Finiscek iz Londona.

Samardžije su 2009. i 2010. godine prodavale dionice firmi "Baron Financial PLC" i "Ecotrade Invest AG" zajedno sa Kenanom Tosunom. Nakon toga su se razišli i postali konkurencija jedni drugim.
